const chalk = require("chalk");
const shelljs = require("shelljs");
const chokidar = require("chokidar");

function debounce(func, wait, immediate) {
  let timeout;
  function debounced(...args) {
    const ctx = this;
    if (timeout) clearTimeout(timeout);

    if (immediate) {
      const callNow = !timeout;
      timeout = setTimeout(() => {
        // è¿™é‡Œåªæœ‰åœ¨ wait æ—¶é•¿ä¹‹åï¼Œtimeout ä¸º nullï¼Œç„¶åè§¦å‘é˜²æŠ–å‡½æ•°æ‰èƒ½ç«‹å³æ‰§è¡Œï¼Œ
        // å¦åˆ™ callNow ä¸º falseï¼Œä¸ä¼šç«‹å³æ‰§è¡Œï¼Œè®¡æ—¶å™¨ä¼šé‡æ–°è®¡æ—¶
        timeout = null;
      }, wait);
      if (callNow) func.apply(ctx, args);
    } else {
      timeout = setTimeout(() => {
        func.apply(ctx, args);
      }, wait);
    }
  }
  debounced.cancel = function cancel() {
    clearTimeout(timeout);
    timeout = null;
  };
  return debounced;
}

function build() {
  console.log();
